import React, { Component } from 'react';
import Navbar from '../navbar';
import Menu from '../menu';
import Chieldberanda from './chieldberanda';

class beranda extends Component {
    render() {
        return(
            <div>
        <Navbar />
        <Menu />
        <Chieldberanda />
        </div>
    ); 
    }
}

export default beranda;
